import React from "react";
import "./App.css";
// import HomePage from "./pages/HomePage";
import Profile from "./pages/Profile";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Profile />} />
      </Routes>
    </Router>
    //   <div className="app">
    //     <HomePage />
    //   </div>
  );
}

export default App;
